import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import { Row, Col, ListGroup, Container, Button, Form } from "react-bootstrap";
import Loader from "../Loader";
import Message from "../Message";

function OwnerScreen() {
  const [codDetails, setCodDetails] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const [newCodDetail, setNewCodDetail] = useState({
    name: "",
    phone: "",
    email: "",
    address: "",
  });

  // Function to fetch COD details from the backend
  const fetchCodDetails = async () => {
    try {
      const response = await fetch("http://localhost:8000/api/cod-details/");
      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      const data = await response.json();
      setCodDetails(data);
    } catch (error) {
      console.error("Error fetching COD details:", error);
      setError("Failed to fetch COD details.");
    } finally {
      setLoading(false);
    }
  };

  // Use useEffect to call fetchCodDetails when the component mounts
  useEffect(() => {
    fetchCodDetails();
  }, []);

  // Handle form input changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setNewCodDetail((prev) => ({ ...prev, [name]: value }));
  };

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch("http://localhost:8000/api/cod-details/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(newCodDetail),
      });
      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      // Refresh the list of COD details
      fetchCodDetails();
      // Clear the form
      setNewCodDetail({ name: "", phone: "", email: "", address: "" });
    } catch (error) {
      console.error("Error adding COD detail:", error);
      setError("Failed to add COD detail.");
    }
  };

  return (
    <Container>
      <Row>
        <Col md={12}>
          <h1>Ordered Cars and COD Details</h1>
          {loading ? (
            <Loader />
          ) : error ? (
            <Message variant="danger">{error}</Message>
          ) : codDetails.length === 0 ? (
            <Message variant="info">
              No COD orders available. <Link to="/">Go Back</Link>
            </Message>
          ) : (
            <ListGroup variant="flush">
              {codDetails.map((detail) => (
                <ListGroup.Item key={detail.id}>
                  <Row>
                    <Col md={3}>
                      <strong>Name:</strong> {detail.name}
                    </Col>
                    <Col md={3}>
                      <strong>Phone:</strong> {detail.phone}
                    </Col>
                    <Col md={3}>
                      <strong>Email:</strong> {detail.email}
                    </Col>
                    <Col md={3}>
                      <strong>Address:</strong> {detail.address}
                    </Col>
                  </Row>
                </ListGroup.Item>
              ))}
            </ListGroup>
          )}
          <h2>Add New COD Detail</h2>
          <Form onSubmit={handleSubmit}>
            <Form.Group controlId="formName">
              <Form.Label>Name</Form.Label>
              <Form.Control
                type="text"
                name="name"
                value={newCodDetail.name}
                onChange={handleChange}
                required
              />
            </Form.Group>
            <Form.Group controlId="formPhone">
              <Form.Label>Phone</Form.Label>
              <Form.Control
                type="text"
                name="phone"
                value={newCodDetail.phone}
                onChange={handleChange}
                required
              />
            </Form.Group>
            <Form.Group controlId="formEmail">
              <Form.Label>Email</Form.Label>
              <Form.Control
                type="email"
                name="email"
                value={newCodDetail.email}
                onChange={handleChange}
                required
              />
            </Form.Group>
            <Form.Group controlId="formAddress">
              <Form.Label>Address</Form.Label>
              <Form.Control
                type="text"
                name="address"
                value={newCodDetail.address}
                onChange={handleChange}
                required
              />
            </Form.Group>
            <Button variant="primary" type="submit">
              Add COD Detail
            </Button>
          </Form>
        </Col>
      </Row>
    </Container>
  );
}

export default OwnerScreen;
